import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux'
import { listAllOrders } from '../redux/actions/orderAction';

const OrderList = () => {
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(listAllOrders());
    }, [])

    const all_orders_data = useSelector(state => state.order.all_orders_data ? state.order.all_orders_data.data : []);

    useEffect(() => {
        if (all_orders_data) {
            console.log(all_orders_data);
        }
    }, [all_orders_data])

    return (
        <h2>{all_orders_data[0]?.customerName}</h2>
    )
}

export default OrderList
